function show_da412b6b(evt, text) {
	var pos = (evt.target.getAttribute("y") < 1092) ? "bottom" : "top";
	var note = document.getElementById(pos + "_note_da412b6b");
	note.textContent = text;
	note.setAttributeNS(null, "visibility", "visible");
	document.getElementById(pos + "_overlay_da412b6b").setAttributeNS(null, "visibility", "visible");
}
function hide_da412b6b(evt) {
	document.getElementById("top_note_da412b6b").setAttributeNS(null, "visibility", "hidden");
	document.getElementById("top_overlay_da412b6b").setAttributeNS(null, "visibility", "hidden");
	document.getElementById("bottom_note_da412b6b").setAttributeNS(null, "visibility", "hidden");
	document.getElementById("bottom_overlay_da412b6b").setAttributeNS(null, "visibility", "hidden");
}
